import React, { Component } from 'react';
import "./Navbar.css";
import fblogo from "../../images/logo.png"

import Grid from '@mui/material/Grid';
// or
class Navbar extends Component {
    constructor(props) {
        super(props);
    }
    state = {  }
    render() { 
        return ( 
            <div>
               <Grid  container>
                <Grid item xs={3}>
                    <div>
                        <img src={fblogo} width="35px"/>
                        <input className='navbar_search' type="text" />
                    </div>
                </Grid>
                <Grid item xs={6}>middle</Grid>
                <Grid item xs={3}>right</Grid>

               </Grid>
            </div>
        );
    }
}
 
export default Navbar;
